query GetProjectQuery($team_id: ID!, $project_id: ID!) {
  result: getProject(input: {teamId: $team_id, projectId: $project_id}) {
    id
    assignees {
      teamMember {
        user {
          ...CabinetOwnerFragment
        }
      }
      documents {
        fileName
      }
    }
    labelerCabinets {
      ...CabinetFragment
    }
    reviewCabinet {
      ...CabinetFragment
    }
  }
}

fragment CabinetFragment on Cabinet {
  id
  owner {
    ...CabinetOwnerFragment
  }
}

fragment CabinetOwnerFragment on User {
  id
  email
  displayName
}
